%spark
// view all of the load configuration
spark.sparkContext.getConf.getAll.foreach(println)

%spark
// the non-binary model type will save all the fields of the data to a hash map and use the show_id as the redis key
// you can use the .option("ttl", 300) to have the data expire in 300 seconds
netflixWithTimeDimension
  .write
  .format("org.apache.spark.sql.redis")
  .option("table", "netflix_norm")
  .option("key.column", "show_id")
  //.option("ttl", 300)
  //.mode("errorIfExists")
  .mode("overwrite")
  .save()
